var input_key_buffer = new Array();

window.addEventListener("keydown", handleKeydown);
function handleKeydown(e) {
  e.preventDefault();
  input_key_buffer[e.keyCode] = true;
}

window.addEventListener("keyup", handleKeyup);
function handleKeyup(e) {
  e.preventDefault();
  input_key_buffer[e.keyCode] = false;
}

const canvas = document.getElementById("maincanvas");
const ctx = canvas.getContext("2d");
var x = 0;
var y = 300;
var vy = 0;
var isJump = false;
var isGameOver = false;
var walkingCount = 0;
const walkRange = 5;
var toRight = true;
var blocks = [
  { x: 0, y: 332, w: 140, h: 32 },
  { x: 150, y: 232, w: 140, h: 32 },
  { x: 300, y: 132, w: 730, h: 32 }
];

var enemies = [
  { x: 350, y: 0, isJump: true, vy: 0 },
  { x: 550, y: 0, isJump: true, vy: 0 },
  { x: 200, y: 180, isJump: true, vy: 0 },
];

window.addEventListener("load", update);

function update() {
  ctx.clearRect(0, 0, 640, 480);
  for (const enemy of enemies) {
    var updatedEnemyX = enemy.x;
    var updatedEnemyY = enemy.y;
    var updatedEnemyInJump = enemy.isJump;
    var updatedEnemyVy = enemy.vy;
    updatedEnemyX = updatedEnemyX - 1;
    
    if (enemy.isJump) {
      updatedEnemyY = enemy.y + enemy.vy;
      updatedEnemyVy = enemy.vy + 0.5;

      const blockTargetIsOn = getBlockTargrtIsOn(
        enemy.x,
        enemy.y,
        updatedEnemyX,
        updatedEnemyY
      );

      if (blockTargetIsOn !== null) {
        updatedEnemyY = blockTargetIsOn.y - 32;
        updatedEnemyInJump = false;
      }
    } else {
      if (
        getBlockTargrtIsOn(enemy.x, enemy.y, updatedEnemyX, updatedEnemyY) ===
        null
      ) {
        updatedEnemyInJump = true;
        updatedEnemyVy = 0;
      }
    }
    enemy.x = updatedEnemyX;
    enemy.y = updatedEnemyY;
    enemy.isJump = updatedEnemyInJump;
    enemy.vy = updatedEnemyVy;
  }
  
  var updatedX = x;
  var updatedY = y;

  if (isGameOver) {
    updatedY = y + vy;
    vy = vy + 0.5;

    if (y > 500) {
      isGameOver = false;
      isJump = false;
      updatedX = 0;
      updatedY = 300;
      vy = 0;
    }
  } else {
   
    if (input_key_buffer[37] || input_key_buffer[39]) {
      walkingCount = (walkingCount + 1) % (walkRange * 10);
    } else {
      walkingCount = 0;
    }

    if (input_key_buffer[37]) {
      toRight = false;
      updatedX = x - 2;
    }
    if (input_key_buffer[38] && !isJump) {
      vy = -10;
      isJump = true;
    }
    if (input_key_buffer[39]) {
      toRight = true;
      updatedX = x + 2;
    }
    if (isJump) {
      updatedY = y + vy;
      vy = vy + 0.5;
      const blockTargetIsOn = getBlockTargrtIsOn(x, y, updatedX, updatedY);

      if (blockTargetIsOn !== null) {
        updatedY = blockTargetIsOn.y - 32;
        isJump = false;
      }
    } else {
      if (getBlockTargrtIsOn(x, y, updatedX, updatedY) === null) {
        isJump = true;
        vy = 0;
      }
    }
    if (y > 500) {
      isGameOver = true;
      updatedY = 500;
      vy = -15;
    }
  }

  x = updatedX;
  y = updatedY;

  if (!isGameOver) {
    for (const enemy of enemies) {
      var isHit = isAreaOverlap(x, y, 32, 32, enemy.x, enemy.y, 32, 32);
      if (isHit) {
        if (isJump && vy > 0) {
          vy = -7;
          enemy.y = 500;
        } else {
          isGameOver = true;
          vy = -10;
        }
      }
    }
  }
  
  var enemyImage = new Image();
  enemyImage.src = "data:image/png;base64,"
  
  for (const enemy of enemies) {
    ctx.drawImage(enemyImage, enemy.x, enemy.y, 32, 32);
  }
  
  var image = new Image();
  image.src = getData64MarioImage(isGameOver, isJump, toRight,  Math.floor(walkingCount / walkRange))
  ctx.drawImage(image, x, y, 32, 32);
  
  var groundImage = new Image();
  groundImage.src = "data:image/jpeg;base64,";
  for (const block of blocks) {
    ctx.drawImage(groundImage, block.x, block.y, block.w, block.h);
  }  
  window.requestAnimationFrame(update);
}

function getBlockTargrtIsOn(x, y, updatedX, updatedY) {
  for (const block of blocks) {
    if (y + 32 <= block.y && updatedY + 32 >= block.y) {
      if (
        (x + 32 <= block.x || x >= block.x + block.w) &&
        (updatedX + 32 <= block.x || updatedX >= block.x + block.w)
      ) {
        continue;
      }
      return block;
    }
  }
  return null;
}

function isAreaOverlap(ax, ay, aw, ah, bx, by, bw, bh) {
  if (bx + bw < ax) {
    return false;
  }
  if (ax + aw < bx) {
    return false;
  }
  if (by + bh < ay) {
    return false;
  }
  if (ay + ah < by) {
    return false;
  }
  return true;
}

function getData64MarioImage(isGameOver, isJump, toRight, walkingCount){
  if(isGameOver){
    return 'data:image/png;base64,'
  }

  if(isJump && toRight){
    return 'data:image/png;base64,'
  } else if(isJump && !toRight){
    return 'data:image/png;base64,'
  }

  if(toRight){
    if(walkingCount === 0){
      return 'data:image/png;base64,'
    } else if (walkingCount === 1){
      return 'data:image/png;base64,' 
    } else if (walkingCount === 2){
      return 'data:image/png;base64,' 
    } else if (walkingCount === 3){
      return 'data:image/png;base64,' 
    } else if (walkingCount === 4){
      return 'data:image/png;base64,' 
    } else if (walkingCount === 5){
      return 'data:image/png;base64,' 
    } else if (walkingCount === 6){
      return 'data:image/png;base64,' 
    } else if (walkingCount === 7){
      return 'data:image/png;base64,' 
    } else if (walkingCount === 8){
      return 'data:image/png;base64,' 
    } else if (walkingCount === 9){
      return 'data:image/png;base64,'
    }
  } else {

    if(walkingCount === 0){
      return 'data:image/png;base64,'
    } else if (walkingCount === 1){
      return 'data:image/png;base64,' 
    } else if (walkingCount === 2){
      return 'data:image/png;base64,' 
    } else if (walkingCount === 3){
      return 'data:image/png;base64,' 
    } else if (walkingCount === 4){
      return 'data:image/png;base64,' 
    } else if (walkingCount === 5){
      return 'data:image/png;base64,'
    } else if (walkingCount === 6){
      return 'data:image/png;base64,'
    } else if (walkingCount === 7){
      return 'data:image/png;base64,'
    } else if (walkingCount === 8){
      return 'data:image/png;base64,'
    } else if (walkingCount === 9){
      return 'data:image/png;base64,'
    }
  }

}